import axios from 'axios';

export default function Signup(name, email, password) {
  return axios.post(url, {
    name: name,
    email: email,
    password: password
  })
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });
}
